import './plans.css';
import React from 'react'
import {plansdata} from './PlanesData';
const Plans = () => {
  return (
    <div className='plans'>
      <div className='header'>
        <span>Ready to Start</span>
        <span>Your Journey</span>
        <span>now withus</span>
      </div>
      <div className="plans">
        {
          plansdata.map((plan)=>{
            return(
              <div className="plan">
                {plan.image}
                <h4>{plan.name}</h4>
              </div>
            )
          })
        }
      </div>
    </div>
  )
}

export default Plans
